import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Header';

const Home = () => <h1></h1>;
const Luminosa = () => <h1>Luminosa Page</h1>;
const Astoria = () => <h1>Astoria Page</h1>;
const Serenata = () => <h1>Serenata Page</h1>;
const Bravura = () => <h1>Bravura Page</h1>;
const Maritima = () => <h1>Mar√≠tima Page</h1>;
const Veloz = () => <h1>Veloz Page</h1>;

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/luminosa" element={<Luminosa />} />
        <Route path="/astoria" element={<Astoria />} />
        <Route path="/serenata" element={<Serenata />} />
        <Route path="/bravura" element={<Bravura />} />
        <Route path="/maritima" element={<Maritima />} />
        <Route path="/veloz" element={<Veloz />} />
      </Routes>
    </Router>
  );
}

export default App;
